int count(char gene[],int size)
{
  int target[4] = {0,0,0,0};
  int i;
  char str[5] = "ATGC";

  //printf("%d\n",size);


  for(i = 0;i < size;i++){
    switch(gene[i]){
    case 'A':
      //  printf("A");
      target[0]++;
      break;
    case 'T':
      //  printf("Test\n");
      target[1]++;
      break;
    case 'G':
      target[2]++;
      break;
    case 'C':
      target[3]++;
      break;
    }
  }
  
  for(i = 0;i < 4; i++){
    printf("%c=%f\n",str[i],target[i]*100/(double)size);
  }
  
  return 0;
}


int strcount(char str[])
{
  int i = 0;
  int t = 0;
  int count = 0;
  char target[] = "AGCTTA";
  
  while(str[i] != '\0'){
    if(target[t] == str[i]){
      if(t == 5){
	i -= 4;
	count++;
	t = 0;
      }else{
	t++;
      }
    }else{
      if(t != 0){
	i -= t;
	t = 0;
      }else{
	t = 0;
      }
    }
    i++;
  }

  printf("count = %d",count);
  printf("\n");

  return 0;

}



    

  
  
  
